import React, { Component, Fragment } from 'react';
import './../css/welcome.css'
import ADBrand from './../img/ADbrand.svg';
import ArrowDown from './../img/arrow-down.svg';
import PortraitAD from './../img/PortraitAD.jpg';
import Navbar from '../components/navbar';


export default class Welcome extends Component{

    render(){
        return(
            <Fragment>
                <Navbar
                    scrollPos={this.props.scrollPos}
                    screenHeight={this.props.screenHeight}
                    language={this.props.language}
                    setLanguage={this.props.setLanguage}
                    deviceType={this.props.deviceType}
                    deviceOrientation={this.props.deviceOrientation}
                />
                <section className="parallax" id="parallax-intro">
                    <div id="logo-brand">
                        <img src={ADBrand} alt="AD logo"/>
                    </div>
                    <button disabled>
                        {this.props.language==="en"?"Scroll down":"Scroll vers le bas"}
                        <img src={ArrowDown} alt="scroll-down"/>
                    </button>
                </section>
                <section id="presentation">
                    {(this.props.scrollPos === null || this.props.scrollPos === 0) && <span id="copyrightAD">&copy; Adrien Desart - 2020</span>}
                    <div className="block">
                        <img src={PortraitAD} alt="Adrien Desart portrait"/>
                        <div>
                            <h2>{this.props.language==="en"?"About me":"A propos de moi"}</h2>
                            <p>{this.props.language==="en"?"Welcome, I'm Adrien. I work as commercial diver for the Puclic Service of Wallonia and also as web developer. My passions are scuba diving, streetfishing, wed developpement and take pictures. This site would share about my work, my id"
                            :"Bonjour, je m'apelle Adrien. Je suis contrôleur d'infrastructure subaquatique pour le compte du Service Publique de Wallonie ainsi que web développeur. Mes centres d'intérets sont la plongée, la pêche, le développement web et la photo. Ce site à pour vocation de partager avec ceux qui le désire mes passions, mes idées et mes travaux."
                            }</p>
                        </div>
                    </div>
                </section>
                <section className="parallax" id="parallax-mindbox">

                </section>
            </Fragment>
        )
    };
}
